import React from 'react';
import images from '../../../images';

const Art = () => {
    return (
        <div>
            <div className="col-md-4 col-6 mx-auto">
            <figure className="gal_img">
            { images.map(({id, img}) => <img key={id} src={img} />)}
            </figure>
        </div>
        </div>
    )
}

export default Art
